import './App.css';

class App extends Component {

  constructor(){
    super();
    this.state = {
      monsters: [{
        name: 'Linda',
        id: '231234'
      },
      {
        name: 'Andrew',

      },
      {
        name: 'Paul'
      },
      {
        name: 'James'
      }] 
    }
  }
  render(){
  return (
    <div className="App">
        {this.state.monsters.map((monster)=>{
          return <h1>{monster.name}</h1>
        })}
    </div>
  );
  }

}

export default App;
